import logo from './logo.svg';
import './App.css';
import products from './data.js'
import Card from './components/Card.jsx'
function App() {
  console.log(products)
  return (
    <div className="App">

      {
        products.map(productData => <Card image = {productData.image} price = {productData.price} description = {productData.description} />)
      }
    </div>
  );
}

export default App;
